import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';

export default function ActionAreaCard() {
  return (
    <Card sx={{ maxWidth: 280 }}>
      <CardActionArea>
        <CardMedia
          component="img"
          height="140"
          image={require('./../../profile_pic/me.jpg')}
          alt="Sean"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            Sean
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Sean Zhu is a CST student. Lizards are a widespread group of squamate reptiles, with over 6,000
            species, ranging across all continents except Antarctica lkaslask;a akjs lkajs lkas lajs lakjs lkajsl 
            ajskl kajslk ajsl ajsl akjsl akjs lakjs lakj lakjs lkajs lasj lajs lkajs lakjs lakjs lakjs lakjs lajs 
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
  );
}
